import React from 'react'
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import '../App.css';

function FilterProduct(props) {
    return (
        <div className='filtering'>
            <ButtonGroup variant="outlined" aria-label="outlined primary button group" size='large'>
                <Button color='inherit' onClick={() => props.apiCall()}>All</Button>
                <Button color='inherit' onClick={() => props.filter(`men's clothing`)}>Men</Button>
                <Button color='inherit' onClick={() => props.filter(`women's clothing`)}> Women</Button>
                <Button color='inherit' onClick={() => props.filter('jewelery')}>Jewellery</Button>
                <Button color='inherit' onClick={() => props.filter('electronics')}>Electronics</Button>
            </ButtonGroup>
        </div>
    )
}

export default FilterProduct
